"use strict";

function f_gold(position, m) {
    function check(f) {
        let prev = position[0];
        let cnt = 1;
        for (let i = 1; i < position.length; i++) {
            let curr = position[i];
            if (curr - prev >= f) {
                prev = curr;
                cnt += 1;
            }
        }
        return cnt >= m;
    }
    position.sort((a, b) => a - b);
    let left = 1;
    let right = position[position.length - 1];
    while (left < right) {
        let mid = (left + right + 1) >> 1;
        if (check(mid)) {
            left = mid;
        } else {
            right = mid - 1;
        }
    }
    return left;
}
